import React, {useState} from 'react';
import '../styles/textarea.css';

const e = React.createElement;

function Console(props){
    const {console} = useState(props);

    const renderText = () => {
        return console.map(line =>{
            return line + "\n" 
        })
    }

    return e('textarea',{
        className:'console',
        value:renderText()
    },)


}

export default Console;
